const Header = () => {
    const isLoggedIn = localStorage.getItem('token');
  
    return (
      <header className="bg-ewaste-green text-white p-4 shadow-md">
        <div className="container mx-auto flex justify-between items-center">
          <div className="flex items-center space-x-2">
            <img src="/assets/images/logo.png" alt="E-Waste Logo" className="h-10" />
            <h1 className="text-xl font-bold">E-Waste Management</h1>
          </div>
          <nav>
            <ul className="flex space-x-6">
              <li><Link to="/pickup" className="hover:text-ewaste-light-green">Pickup</Link></li>
              <li><Link to="/buy-sell" className="hover:text-ewaste-light-green">Buy & Sell</Link></li>
              <li><Link to="/our-mission" className="hover:text-ewaste-light-green">Our Mission</Link></li>
              {isLoggedIn ? (
                <>
                  <li><Link to="/account" className="hover:text-ewaste-light-green">Account</Link></li>
                  <li><Link to="/logout" className="hover:text-ewaste-light-green">Logout</Link></li>
                </>
              ) : (
                <>
                  <li><Link to="/login" className="hover:text-ewaste-light-green">Login</Link></li>
                  <li><Link to="/register" className="hover:text-ewaste-light-green">Register</Link></li>
                </>
              )}
              <li><Link to="/contact" className="hover:text-ewaste-light-green">Contact</Link></li>
            </ul>
          </nav>
        </div>
      </header>
    );
  };
